import {
  Grid,
  Row,
  Col,
} from 'react-bootstrap';
class Timeslots extends Component {
  render() {
    return (

    <Grid>
      <Row className="timeslot">
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
