        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
      </Row>
    </Grid>
    );
  }
}

export default Timeslots;
